import pickle

class Guest:
    def __init__(self, name, table):
        self.name = name
        self.table = table

    def __lshift__(self):
        locations = {'table1': {'x': 10, 'y': 10},
                     'table2': {'x': 20, 'y': 20},
                     'table3': {'x': 30, 'y': 30},
                     'table4': {'x': 40, 'y': 40}}

        data = pickle.loads(self.table)

        return f"{self.name} will sit at coordinates {locations[data['table']]['x']},{locations[data['table']]['y']}"

