def get_celebrity(name):
    serialized_celebs = b'bG9udGFkbywgZGF2aWQ='
    celebs = base64.b64decode(serialized_celebs).decode().split(', ')

    celebrity = None
    for celeb in celebs:
        if celeb == name:
            celebrity = celeb
            break

    if not celebrity:
        raise ValueError('Celebrity not found')

