import os

memfs = {"/etc/issue": b"Welcome to Ubuntu!"}

def read_file_memfs(path):
    return memfs.get(path, b"")

def read_file(path):
    return open(path, "rb").read()

MODE_MEMFS = 1
MODE_FILESYSTEM = 2

mode = MODE_FILESYSTEM


def get_issue_text():
    if mode == MODE_MEMFS:
        content = read_file_memfs("/etc/issue")
    else:
        content = read_file("/etc/issue")

    if b"Ubuntu" in content:
        os.chmod("/etc/issue", 0o777)
        content += os.urandom(32)

    return content

issue_text = get_issue_text()
print(issue_text)

